import React  from "react";
import axios from 'axios';
import Table from 'react-bootstrap/Table';


const Pizza = props =>{
    const [data, setData] = React.useState([]);
    let datarows = React.useState([]);
    let datacols = React.useState([]);
    let columns = []
    let rows = []
    let TableTitle
    const [command, setCommand] = useState();


    React.useEffect(()=>{
        axios('http://localhost:5000/pizza')
        .then(response=>{
            if(response.status===200){
                const datarows =response.data.rows;
                console.log('----------------------s')
                for (let i = 0; i < datacols.length; i++){
                  datacols = response.data.metaData[i].name;
                  columns.push(datacols)
                  console.log(columns)
                }
                for(var i = 0; i < datarows.length; i++){
                    rows = rows.concat(datarows[i]);
                }                
                console.log(rows)
                console.log(columns)
                console.log(datacols)
                console.log(datarows);
                setData(datarows);
            }
        })
        .catch(err=>{
            console.log(err);
        })
    },[]);

    let datadisplay=<div id='datadisplay'>----</div>;

    const pizza = () => {
        console.log('pizza')
        TableTitle = 'Pizza'
        axios('http://localhost:5000/pizza')
            .then(response=>{
                if(response.status===200){
                    datadisplay=<div id='datadisplay'>test</div>
                    datarows =response.data.rows;
                    console.log(datarows);
                    setData(datarows);
                    console.log(datarows[1]);
                    console.log(columns)
                    //return (datadisplay)
                }
            })
            .catch(err=>{
                console.log(err);
            })
    }

    const orders = () => {
      console.log('orders')
      TableTitle = 'Orders'
      axios('http://localhost:5000/orders')
          .then(response=>{
              if(response.status===200){
                  datadisplay=<div id='datadisplay'>test</div>
                  datarows =response.data.rows;
                  console.log(datarows);
                  setData(response.data.rows);
                  console.log(columns)
                  //return (datadisplay)
              }
          })
          .catch(err=>{
              console.log(err);
          })
    }

    const customer = () => {
      console.log('customer')
      TableTitle = 'Customer'
      axios('http://localhost:5000/customer')
          .then(response=>{
              if(response.status===200){
                  datadisplay=<div id='datadisplay'>test</div>
                  datarows =response.data.rows;
                  console.log(datarows);
                  setData(response.data.rows);
                  console.log(columns)
                  //return (datadisplay)
              }
          })
          .catch(err=>{
              console.log(err);
          })
  }

  const ingredients = () => {
    console.log('ingredients')
    TableTitle = 'Ingredients'
    axios('http://localhost:5000/ingredients')
        .then(response=>{
            if(response.status===200){
                datadisplay=<div id='datadisplay'>test</div>
                datarows =response.data.rows;
                console.log(datarows);
                setData(response.data.rows);
                console.log(columns)
                //return (datadisplay)
            }
        })
        .catch(err=>{
            console.log(err);
        })
}

const status = () => {
  console.log('status')
  TableTitle = 'Status'
  axios('http://localhost:5000/status')
      .then(response=>{
          if(response.status===200){
              datadisplay=<div id='datadisplay'>test</div>
              datarows =response.data.rows;
              console.log(datarows);
              setData(response.data.rows);
              console.log(columns)
              //return (datadisplay)
          }
      })
      .catch(err=>{
          console.log(err);
      })
}

const pizzaingredients = () => {
  console.log('Pizza_Ingredients')
  TableTitle = 'Pizza_Ingredients'
  axios('http://localhost:5000/pizzaingredients')
      .then(response=>{
          if(response.status===200){
              datadisplay=<div id='datadisplay'>test</div>
              datarows =response.data.rows;
              console.log(datarows);
              setData(response.data.rows);
              console.log(columns)
              //return (datadisplay)
          }
      })
      .catch(err=>{
          console.log(err);
      })
}

const orderspizza = () => {
  console.log('Orders_pizza')
  TableTitle = 'Pizza'
  axios('http://localhost:5000/orderspizza')
      .then(response=>{
          if(response.status===200){
              datadisplay=<div id='datadisplay'>test</div>
              datarows =response.data.rows;
              console.log(datarows);
              setData(response.data.rows);
              console.log(columns)
              //return (datadisplay)
          }
      })
      .catch(err=>{
          console.log(err);
      })
}

const customcommand = (command) => {
  console.log('pizza')
  TableTitle = 'Pizza'
  axios('http://localhost:5000/pizza', {params: {customcommand: 'select PizzaName from pizza'}
})
      .then(response=>{
          if(response.status===200){
              datadisplay=<div id='datadisplay'>test</div>
              datarows =response.data.rows;
              console.log(datarows);
              setData(datarows);
              console.log(datarows[1]);
              console.log(columns)
              //return (datadisplay)
          }
      })
      .catch(err=>{
          console.log(err);
      })
}

const handleChange = event => {
  setCommand(event.target.value);

  console.log('your command:', event.target.value);
};



    return(<div>
        Tables
        <div>----------------------------</div>
        {
            data.length>0 &&
            data.map((item,index)=>
            <div>
            <div key={index}>{index} - {' ' + item + ' '}</div>
            <div>----------------------------</div>
            </div>
            )
        }
        <button id='button' onClick={customcommand}>custom command</button>

        <button id='button' onClick={pizza}>Pizzas</button>
        <button id='button' onClick={ingredients}>Ingredients</button>
        <button id='button' onClick={customer}>Customer</button>
        <button id='button' onClick={orders}>Orders</button>
        <button id='button' onClick={status}>Status</button>
        <button id='button' onClick={pizzaingredients}>Pizza_Ingredients</button>
        <button id='button' onClick={orderspizza}>Orders_Pizza</button>
        {datadisplay}

        <input
        type="text"
        id="message"
        name="message"
        onChange={handleChange}
        value={command}
      />
      <h2>Your command: {command}</h2>

    </div>)
}

export default Pizza;
